import Home from "pages/home.js";
import Contact from "pages/contact.js";


var indexRoutes = [
  { path: "/contact-us", name: "ContactPage", component: ContactPage },
  { path: "/", name: "HomePage", component: HomePage }
];

export default indexRoutes;
